import axios from 'axios';

const API = axios.create({ baseURL: 'http://localhost:5000'});

export const registerSeller = (seller) => API.post('/seller/register',seller); 
export const fetchAllSeller = () => API.get('/seller/');
export const customerSignin = (formData) => API.post('/auth/customerSignin',formData);
export const customerSignup = (formData) => API.post('/auth/customerSignup',formData);
export const sellerSignup = (formData) => API.post('/auth/sellerSignup',formData);
export const sellerSignin = (formData) => API.post('/auth/sellerSignin',formData);
